import React from 'react';
import {Row, Col} from 'antd';

export default class Admin extends React.Component{

    render(){
        return (
            <Row>
                <Col span="4">
                    Left                    
                </Col>
                <Col span="20">
                    Right              
                </Col>
            </Row>
        );
    }
}
